import React from 'react';
import '../Css/SkillHighlights.css';

const skillCategories = [
  {
    category: "Full-Stack Development",
    skills: [
      { name: "C#", icon: "/assets/icons/csharp.png" },
      { name: "ASP.NET", icon: "/assets/icons/aspnetcore.png" },
      { name: "ReactJS", icon: "/assets/icons/react.png" }
    ]
  },
  {
    category: "UI/UX Design",
    skills: [
      { name: "Figma", icon: "/assets/icons/figma.png" },
      { name: "Adobe XD", icon: "/assets/icons/adobexd.png" },
      { name: "Responsive Design", icon: "/assets/icons/responsive.png" }
    ]
  },
  {
    category: "Data Analysis & Visualization",
    skills: [
      { name: "Power BI", icon: "/assets/icons/powerbi.png" },
      { name: "Tableau", icon: "/assets/icons/tableau.png" },
      { name: "Python", icon: "/assets/icons/python.png" },
      { name: "Pandas", icon: "/assets/icons/pandas.png" },
      { name: "Scikit-learn", icon: "/assets/icons/scikitlearn.png" }
    ]
  },
  {
    category: "DevOps",
    skills: [
      { name: "Azure DevOps", icon: "/assets/icons/azuredevops.png" },
      { name: "Git", icon: "/assets/icons/git.png" },
      { name: "Docker", icon: "/assets/icons/docker.png" },
      { name: "Kubernetes", icon: "/assets/icons/kubernetes.png" }
    ]
  }
];

const SkillHighlights = () => {
  return (
    <section id="skills" className="skills-section">
      <div className="skill-categories">
        {skillCategories.map((group, idx) => (
          <div key={idx} className="skill-category">
            <h3>{group.category}</h3>
            <div className="skills-grid">
              {group.skills.map((skill, index) => (
                <div key={index} className="skill-item">
                  <img src={skill.icon} alt={skill.name} />
                  <span>{skill.name}</span>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default SkillHighlights;
